import React, { Component } from "react";
import TodoContainer from "./TodoContainer";

const style = {
  container: {
    height: "100vh",
    width: '100%'
  }
};

export const Main = () => {
  return (
    <div style={style.container}>
      <TodoContainer />
    </div>
  );
};

export default Main;
